import { Box } from '@mui/system'
import React from 'react'
import {navData} from '../Constants/data'

const Navbar = () => {
  return (
   <Box>
    {
            navData.map(data =>(
                <Box>
                    <img src={data.url} alt="nav"/>
                    <p>{data.text}</p>
                </Box>
            ))
    }
   </Box>
    )
}

export default Navbar
